import styles from "./../../assets/views/pages/SystemLogs.module.css";

function SystemLogs(){
    return (
        <div className={styles.containerSystemLogs}>
            <p>Logs do Sistema</p>
            <div className={styles.searchUser}>
                <input type="text" placeholder="Pesquisar..."></input>
            </div>
        </div>
    )
}

export default SystemLogs;
